import { createUseStyles } from 'react-jss';
const useStyles = createUseStyles({
	lightboxImg: {
		height: '80vh',
		maxWidth: '90vw',
		objectFit: 'cover',
	},
});


export function LightBoxImage(props) {
	return <img className={lightboxImg} src={props.regular} alt={props.description}></img>;
}
